import Link from "next/link";
import styles from "../components/styles/navbar.module.css";
import Image from "next/image";

const NavBar = () => {
  return (
    <div className={styles.navbar}>
      <Image
        className={styles.navbarLogo}
        src="/assets/Logo@3x.png"
        alt="logo"
        height="69px"
        width="69px"
        style={{ alignSelf: "flex-start", border: "2px solid red" }}
      />
      <ul>
        <li>
          <Link href="/">
            <a>კაცთა ეროვნული</a>
          </Link>
        </li>
        <li>
          {" "}
          <Link href="/about">
            <a>ქალთა ეროვნული</a>
          </Link>
        </li>
        <li>
          {" "}
          <Link href="/about">
            <a> 21-წლამდელები</a>
          </Link>
        </li>
        <li>
          {" "}
          <Link href="/about">
            <a>ასაკობრივები</a>
          </Link>
        </li>
        <li>
          {" "}
          <Link href="/about">
            <a> ფანშოპი</a>
          </Link>
        </li>
      </ul>
    </div>
  );
};

export default NavBar;
